gid Brannagh扮演Atthea Martin医生，丈夫被一个醉酒驾驶的司机开车撞死，她决定将所有精力投入创伤急救工作，希望能减轻心中的痛苦。 Robert Bailey Jr.扮演年轻的住院医生Paul，渴望成功但是为人过于拘谨。 Jill Flint扮演女主角Jordan Santos医生，T.C.的前女友，现在已经和别人订婚。Jordan最近刚刚被提拔为主管夜间工作的主任，她一方面要证明自己的价值，一方面要取悦上司Michael，同时还要确保T.C.不捅娄子，忙得不可开交。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1000:"第01集$http://yanzishan.shuhu-zuida.com/20190831/15852_d694e72f/index.m3u8#第02集$http://yanzishan.shuhu-zuida.com/20190831/15851_9b5bf9f4/index.m3u8#第03集$http://yanzishan.shuhu-zuida.com/20190831/15850_a1a67f7a/index.m3u8#第04集$http://yanzishan.shuhu-zuida.com/20190831/15849_4b493b8d/index.m3u8#第05集$http://yanzishan.shuhu-zuida.com/20190831/15848_6c0aedea/index.m3u8#第06集$http://yanzishan.shuhu-zuida.com/20190831/15847_649ea7cd/index.m3u8#第07集$http://yanzishan.shuhu-zuida.com/20190831/15846_e1b14956/index.m3u8#第08集$http://yanzishan.shuhu-zuida.com/20190831/15845_7cfb5842/index.m3u8#第09集$http://yanzishan.shuhu-zuida.com/20190831/15844_19c16b38/index.m3u8#第10集$http://yanzishan.shuhu-zuida.com/20190831/15843_8f83d5c6/index.m3u8#第11集$http://yanzishan.shuhu-zuida.com/20190831/15842_d32d4cb4/index.m3u8#第12集$http://yanzishan.shuhu-zuida.com/20190831/15841_4f8bf71d/index.m3u8#第13集$http://yanzishan.shuhu-zuida.com/20190831/15840_6ceb12a6/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:16;s:9:"type_name";s:9:"欧美剧";s:7:"type_en";s:7:"oumeiju";s:9:"type_sort";i:4;s:8:"type_mid";i:1;s:8:"type_pid";i:2;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:72:"好看的欧美剧,最新欧美剧,经典欧美剧,国语欧美剧电影";s:8:"type_des";s:205:"2018最新欧美剧，好看的欧美剧大全和排行榜推荐，免费欧美剧在线观看和视频在线播放是由本网站整理和收录，欢迎欧美剧爱好者来到这里在线观看欧美剧";s:10:"type_title";s:72:"好看的欧美剧-最新欧美剧-经典欧美剧-最新欧美剧推荐";s:10:"type_un